/// <summary>
///     Deletes the selected records from the database.
/// </summary>
public void deleteSelectedRecords()
{
    Common              logOrigin;
    ReqDemPlanLogSource selectedLog     = reqDemPlanLogSource_ds.getFirst(true);
    var                 latestForecast  = ReqDemPlanGeneratedForecast::findLatest();

    // in case nothing is marked (no multi-selection done), we delete the
    // current record. otherwise UX is confusing
    if (!selectedLog)
    {
        selectedLog = reqDemPlanLogSource;
    }

    while (selectedLog)
    {
        logOrigin = selectedLog.getOrigin(true);

        if (logOrigin.RecId != 0)
        {
            if (latestForecast && latestForecast.RecId == logOrigin.RecId)
            {
                warning("@DMP:DeleteLatestForecastWarning");
            }
            else
            {
                ttsBegin;
                logOrigin.delete();
                ttsCommit;
            }
        }

        selectedLog = reqDemPlanLogSource_ds.getNext();
    }

    reqDemPlanLogSource_ds.research(true);
}

/// <summary>
///     Refreshes the grid containing the companies to forecast model mappings.
/// </summary>
public void refreshImportedModels()
{
    container   current;
    int         conSize;
    int         i;

    if (!reqDemPlanImportedForecast.RecId)
    {
        return;
    }

    delete_from reqDemPlanImportForecastTmp;

    conSize = conLen(reqDemPlanImportedForecast.CompanyForecastModelMapping);

    for (i = 1; i <= conSize; i++)
    {
        current = conPeek(reqDemPlanImportedForecast.CompanyForecastModelMapping, i);

        reqDemPlanImportForecastTmp.clear();
        [reqDemPlanImportForecastTmp.ForecastDataAreaID, reqDemPlanImportForecastTmp.ForecastModelId] = current;
        reqDemPlanImportForecastTmp.insert();
    }

    reqDemPlanImportForecastTmp_ds.executeQuery();
}

/// <summary>
///     Updates the visibility of the detail groups for the current record.
/// </summary>
public void updateDetailTab()
{
    generationGroup.visible(reqDemPlanLogSource.LogType == ReqDemPlanSessionLogType::GenerationLog);
    importGroup.visible(reqDemPlanLogSource.LogType == ReqDemPlanSessionLogType::ImportLog);
}

public int active()
{
    int ret;

    ret = super();

    element.updateDetailTab();

    return ret;
}

public void init()
{
    QueryBuildDataSource dataSource;

    super();

    dataSource = this.query().dataSourceTable(tableNum(ReqDemPlanGeneratedForecast));
    dataSource.clearLinks();
    dataSource.clearDynalinks();
    dataSource.addLink(
                fieldNum(ReqDemPlanLogSource, TaskCollection),
                fieldNum(ReqDemPlanGeneratedForecast, TaskCollection));
    dataSource.joinMode(JoinMode::OuterJoin);
}

public int active()
{
    int ret;

    ret = super();

    element.refreshImportedModels();

    return ret;
}

